import { Box } from '@mui/material'
import React from 'react'

const Footers = () => {



  return (
    <Box>
      <Box>
      <Box sx={{ flex: "1.25", marginLeft:"22px", justifyContent:"center"  
        }}
          >
            <img
              src={heroImg}
              alt="heroImg"
              style={{ maxWidth:"80%", marginLeft:"10px"}}
            />
          </Box>
      </Box>
    </Box>
  )
}

export default Footers
